import React from 'react';
import bootstrapcarsoule from "../../asstes/images/newyark.jpg";
import bootstrapcarsoule1 from "../../asstes/images/PK.png";
import bootstrapcarsoule2 from "../../asstes/images/RCB.png";

const BootstrapCarousel = () => {
  return (
    <div id="carouselExampleSlidesOnly" className="carousel slide" data-bs-ride="carousel">
      <div className="carousel-inner">
        <div className="carousel-item active">
          <img
            src={bootstrapcarsoule2}
            className="d-block w-100"
            alt="Slide 1"
          />
        </div>
        <div className="carousel-item">
          <img
            src={bootstrapcarsoule}
            className="d-block w-100"
            alt="Slide 2"
          />
        </div>
        <div className="carousel-item">
          <img
            src={bootstrapcarsoule1}
            className="d-block w-100"
            alt="Slide 3"
          />
        </div>
      </div>
    </div>
  );
};

export default BootstrapCarousel;
